const maleURI =
    "data:application/json;base64,";
const femaleURI =
    "data:application/json;base64,";

const male = JSON.parse(atob(maleURI.substring(29)));
const female = JSON.parse(atob(femaleURI.substring(29)));

const $ = (s) => document.querySelector(s);
const $$ = (s) => document.querySelectorAll(s);

$("#male-btn").addEventListener("click", () => {
    generateName(male);
});

$("#female-btn").addEventListener("click", () => {
    generateName(female);
});

function generateName(json) {
    const names = json.names.slice(json.lens[4]);
    const ix = Math.floor(Math.random() * names.length);
    console.log(names[ix]);

    animateName(names[ix].charAt(0).toUpperCase() + names[ix].substring(1));
}

function animateName(name) {
    const nameEl = $("#name");

    for (let i = 0; i < name.length; i++) {
        setTimeout(() => {
            nameEl.innerText = name.substring(0, i + 1);
        }, i * 100);
    }
}
